import React from "react";
import './Chats.css';
import Chat from "./Chat";

function Chats(){
    return (
        <div className="chats">
            <Chat name="Sayuri"
            message="Hey sweetie!"
            timestamp="40 seconds ago"
            profilePic=""/>
            <Chat name="Mayumi"
            message="Good morning!"
            timestamp="12 seconds ago"
            profilePic=""/>
            <Chat name="Miyuki"
            message="Hiii!"
            timestamp="25 seconds ago"
            profilePic=""/>
            <Chat name="Mayra"
            message="Hellooo!"
            timestamp="37 seconds ago"
            profilePic=""/>
        </div>
    );
}

export default Chats;
